<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta
      name="viewport"
      content="width=device-width,user-scalable=no,initial-scale=1.0, minimum-scale=1.0,maximum-scale=1.0"
    />

    <title>Winline</title>
  <style>
    article,
aside,
details,
figcaption,
figure,
footer,
header,
hgroup,
menu,
nav,
section {
  display: block;
}
html,
body,
div,
span,
applet,
object,
iframe,
h1,
h2,
h3,
h4,
h5,
h6,
p,
blockquote,
pre,
a,
abbr,
acronym,
address,
big,
cite,
code,
del,
dfn,
em,
img,
ins,
kbd,
q,
s,
samp,
small,
strike,
strong,
sub,
sup,
tt,
var,
b,
u,
i,
center,
dl,
dt,
dd,
ol,
ul,
li,
fieldset,
form,
label,
legend,
table,
caption,
tbody,
tfoot,
thead,
tr,
th,
td,
article,
aside,
canvas,
details,
embed,
figure,
figcaption,
footer,
header,
hgroup,
menu,
nav,
output,
ruby,
section,
summary,
time,
mark,
audio,
video,
button {
  margin: 0;
  padding: 0;
  border: 0;
  font-size: 100%;
  font: inherit;
  vertical-align: baseline;
  box-sizing: border-box;
  color: #fff;
  transition: 0.3s;
  font-family: Montserrat;
}
img,
svg {
  transition: 0.3s;
}
a:hover,
button:hover {
  cursor: pointer;
  opacity: 0.7;
}
.dnone {
  display: none;
}
a {
  text-decoration: none;
}
input {
  box-sizing: border-box;
}
.free_img {
  position: relative;
  height: 0px;
  width: 0px;
  display: flex;
  justify-content: center;
  align-items: center;
}
* {
  opacity: 0.3s;
}
body {
  background-color: #150d34;
}
.content {
  width: 100vw;
  height: 100vh;
}
.content .top {
  overflow: hidden;
}
.content .top .topBg {
  position: absolute;
  bottom: 0;
  width: 48vw;
  z-index: -1;
}
.top {
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
}
.header {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  text-align: center;
}
.slider-container {
  margin: 20px auto;
}
.slider {
  display: flex;
  transition: transform 0.5s ease-in-out;
  justify-content: start;
  margin: 5vh;
}
.slide {
  margin-right: 10px;
  transition: all 0.3s;
  opacity: 1;
}
.slide.hide {
  opacity: 0;
}
.slide img {
  height: auto;
}
.bottom {
  margin-right: 8px;
}
.bottom__box {
  display: flex;
  justify-content: space-between;
  margin-bottom: 10px;
}
.prizez__box {
  display: flex;
  align-items: stretch;
  gap: 8px;
}
.prizez__box + .prizez__box {
  margin-top: 8px;
}
@keyframes winAnim {
  0% {
    transform: scale(1.1);
  }
  50% {
    transform: scale(1.2);
  }
  80% {
    transform: scale(0.9);
  }
  to {
    transform: scale(1.15);
  }
}
.content {
  display: flex;
  justify-content: space-evenly;
  align-items: center;
}
.content .top,
.content .bottom {
  max-width: 48%;
  overflow: hidden;
}
.content .top img,
.content .bottom img {
  border-radius: 1vw;
  width: 15vw;
}
.content .top .logoImg,
.content .bottom .logoImg {
  max-width: 20vw;
  width: 100%;
  margin-bottom: 20px;
}
.fortuna {
  display: flex;
  flex-direction: column;
}
.title {
  font-size: 6vh;
  margin-bottom: 20px;
}
.text {
  font-size: 4.1vh;
  color: #e6d487;
}
.slider-container {
  margin-bottom: 8px;
}
.firstPrize.win,
.lastPrize.win {
  transform: scale(1.5);
}
.firstPrize.win img,
.lastPrize.win img {
  border: 1px solid #fe6826;
  border-radius: 1vw;
}
.first.win,
.last.win {
  border: 1px solid #fe6826;
  border-radius: 1vw;
  animation: winAnim 1s;
  transform: scale(1.15);
}
.btn {
  text-align: center;
  margin: 0 auto;
  max-width: 20vw;
  width: 100%;
  display: inline-block;
  padding: 2vh 0;
  border-radius: 9vh;
  border: 1px solid #b3f9e1;
  background: #150d34;
  box-shadow: 0 2.907px 2.907px #00000040;
  cursor: pointer;
  text-transform: uppercase;
}
.btn:hover {
  border-color: #fe6826;
  background: #1d1347;
}
.bottom {
  font-size: 3vh;
}
.bottom .prizez img {
  max-width: 18vh;
  width: 100%;
}
@media screen and (orientation: portrait) and (max-width: 600px) {
  .content {
    flex-direction: column;
    justify-content: flex-start;
  }
  .content .top,
  .content .bottom {
    max-width: 100%;
  }
  .content .top img,
  .content .bottom img {
    width: 9.7vh;
  }
  .content .top .logoImg,
  .content .bottom .logoImg {
    max-width: 20vh;
    width: 100%;
    margin: 20px 0;
  }
  .content .top {
    position: relative;
  }
  .content .top .topBg {
    width: 100vw;
  }
  .content .top .title {
    font-size: 9vw;
    margin: 0;
  }
  .content .top .text {
    font-size: 6vw;
  }
  .content .top .slider {
    margin: 2vh;
  }
  .content .top .slider img {
    width: 16vh;
  }
  .content .top .btn {
    max-width: 60vw;
    padding: 1vh 0;
    margin-bottom: 20px;
  }
  .content .bottom {
    max-width: 90vw;
  }
  .content .bottom .prizez__box {
    flex-wrap: nowrap;
  }
}

  </style>
  </head>
